    function gridInfScroll(o) {
        var $grid = o.v;
        var con = $grid.find(sawecontentc);
        var scon = con.children().first();
        var loading;
        var gonext = 0;
        var lastSt;
        function adjustMargin() {
            var diff = Math.max(con.height() - scon.height() + 25, 25);
            scon.css('margin-bottom', diff + 'px');
        }

        adjustMargin();

        function setSt(st) {
            lastSt = st;
            con.scrollTop(st);
        }

        con.on('scroll', function () {
            var res = o.lrs;
            var st = con.scrollTop();
            var sconh = scon.outerHeight(true);
            var conh = con.innerHeight();
            var maxst = sconh - conh + 1;
            var lst = lastSt;

            adjustMargin();

            if (loading) {
                con.scrollTop(lst);
            } else {
                if (lst < st) {

                    if (gonext < 0) {
                        gonext = 0;
                    }

                    if (st > maxst - 3) {
                        gonext++;
                        if (gonext > 1 && res.p < res.pc) {
                            loading = 1;
                            $.when(nextPage())
                                .done(function () {
                                    gonext = loading = 0;
                                    st = 1;
                                    setSt(st);
                                });
                        } else {
                            st--;
                            setSt(st);
                        }
                    }
                }
                else if (lst > st) {

                    if (gonext > 0) {
                        gonext = 0;
                    }

                    if (st < 3) {
                        gonext--;
                        if (gonext < -2 && res.p > 1) {
                            loading = 1;
                            $.when(prevPage())
                                .done(function () {
                                    gonext = loading = 0;
                                    st = maxst;
                                    setSt(st);
                                });
                        } else {
                            st++;
                            setSt(st);
                        }
                    }
                }

                lastSt = st;
            }

            function nextPage() {
                return dapi($grid).load({ oparams: { page: res.p + 1 } });
            }

            function prevPage() {
                return dapi($grid).load({ oparams: { page: res.p - 1 } });
            }
        });
    }

